import React from 'react';

function Member(props) {
  return (
      <div className='col-lg-3 col-md-6 col-sm-6 col-xs-12 border'>
          <div className='card'>
              <div className='card-header'></div>
              <div></div>
          </div>
      <h2 className=''>{props.name}</h2>
      </div>
  )
}

export default Member;
